function faqs(){let faqTitle=jQuery('.faq__title');faqTitle.on('click',function(e){e.preventDefault();let description=jQuery(this).next('.faq__description');let others=jQuery(this).closest('.faq__item').siblings();jQuery(this).find('.faq__icon').toggleClass('show-faq');others.find('.faq__icon').removeClass('show-faq');others.find('.faq__description').slideUp();description.slideToggle()});if(window.screen.width>640){if(jQuery('body.post-type-archive-faq').length){if(jQuery('.faq-1').length){jQuery('.faq-1 .faq__title').trigger("click")}else{jQuery('.faq-11 .faq__title').trigger("click")}}}}
function variationToRadio(){jQuery(document).on('change','.variation-radios input',function(){jQuery('.variation-radios input:checked').each(function(index,element){let $el=jQuery(element);let thisName=$el.attr('name');let thisVal=$el.attr('value');jQuery('select[name="'+thisName+'"]').val(thisVal).trigger('change')})});jQuery(document).on('woocommerce_update_variation_values',function(){jQuery('.variation-radios input').each(function(index,element){let $el=jQuery(element);let thisName=$el.attr('name');let thisVal=$el.attr('value');$el.removeAttr('disabled');if(jQuery('select[name="'+thisName+'"] option[value="'+thisVal+'"]').is(':disabled')){$el.prop('disabled',!0)}})})}
function quantityInput(){jQuery(function(){if(!String.prototype.getDecimals){String.prototype.getDecimals=function(){let num=jQuery(this),match=(''+num).match(/(?:\.(\d+))?(?:[eE]([+-]?\d+))?$/);if(!match){return 0}
return Math.max(0,(match[1]?match[1].length:0)-(match[2]?+match[2]:0))}}
jQuery(document.body).on('click','.product-quantity--plus, .product-quantity--minus',function(){let $qty=jQuery(this).closest('.product-quantity--change').find('.quantity .qty'),currentVal=parseFloat($qty.val()),max=parseFloat($qty.attr('max')),min=parseFloat($qty.attr('min')),step=$qty.attr('step');if(!currentVal||currentVal===''||currentVal==='NaN')currentVal=0;if(max===''||max==='NaN')max='';if(min===''||min==='NaN')min=1;if(step==='any'||step===''||step===undefined||parseFloat(step)==='NaN')step=1;if(jQuery(this).is('.product-quantity--plus')){if(max&&(currentVal>=max)){$qty.val(max);if(jQuery('.shop-buttons-flex').length){jQuery(this).closest('.shop-buttons-flex').find('.add_to_cart_button').attr('data-quantity',max)}}else{$qty.val((currentVal+parseFloat(step)).toFixed(step.getDecimals()));if(jQuery('.shop-buttons-flex').length){jQuery(this).closest('.shop-buttons-flex').find('.add_to_cart_button').attr('data-quantity',currentVal+parseFloat(step)).toFixed(step.getDecimals())}}}else{if(min&&(currentVal<=min)){$qty.val(min);if(jQuery('.shop-buttons-flex').length){jQuery(this).closest('.shop-buttons-flex').find('.add_to_cart_button').attr('data-quantity',min)}}else if(currentVal>0){$qty.val((currentVal-parseFloat(step)).toFixed(step.getDecimals()));if(jQuery('.shop-buttons-flex').length){jQuery(this).closest('.shop-buttons-flex').find('.add_to_cart_button').attr('data-quantity',currentVal-parseFloat(step)).toFixed(step.getDecimals())}}}
setTimeout(function(){jQuery("[name='update_cart']").removeAttr('disabled');jQuery("[name='update_cart']").trigger("click")},500)})})}
