function stickyHeader(){let header=jQuery('.header');let headerH=header.outerHeight();let lastScrollTop=0;jQuery(window).on('scroll',function(){let st=jQuery(this).scrollTop();if(jQuery(document).scrollTop()>=headerH){if(st>lastScrollTop){jQuery('.header').addClass("sticky-hide");jQuery('.header').removeClass("sticky")}else{jQuery('.header').addClass("sticky");jQuery('.header').removeClass("sticky-hide")}
lastScrollTop=st}else{jQuery('.header').removeClass("sticky-hide");jQuery('.header').removeClass("sticky")}})}
function openMenu(){jQuery('.get-menu, .close-menu').on('click',function(e){e.preventDefault();let menu=jQuery('.agr-menu');let body=jQuery('body');menu.toggleClass('show-menu');body.toggleClass('fixed')})};AOS.init({easing:'ease-in-out-sine',disable:function(){var maxWidth=800;return window.innerWidth<maxWidth}})